window.bookSummaryJSON = "<h4><b>Series is finished!<br><br>Vicki Bohanan is back and sporting a whole new mystery. Blackmail lands at her feet on the eve of preseason football.<br><br>And for a woman with an attitude the size of Texas, it’s gonna take more than a pigskin to plug her pie hole.</b></h4><br>A Texas Ranger, an undercover boss, and a hunky radio personality walk into the bar and keep Vicki’s head spinning like a ride at the state fair. The only score she wants to settle is with her renovated residence. But when a certain Aussie model invites her to San Antonio for a romantic Alamo shootout – cameras this time, folks – Vicki can’t escape temptation and saddles up for a cozy rendezvous.<br><br>Then runs smackdab into unexpected trouble courtesy of Reginald von Braun.<br><br>Reggie’s got secrets guaranteed to set the South aflame – and someone has discovered the truth. With blackmail in the bargain, Vicki must help solve the crime and uncover the criminal threatening to expose the past right as Reggie’s on the cusp of finding a future.<br><br>All while protecting certain revelations.<br><br>That’s hard to do when you’re plagued with that dreaded disease known as foot-in-mouth. But Vicki’s not about to let a friend go down without a fight.<br><br>No matter how catty the kitty gets.<br><br>Join the laugh-out-loud capers in book two of the Bartender Babe Chronicles that readers of Janet Evanovich are calling the Texas Stephanie Plum. Light among humorous mysteries and romantic comedies and long on—well as they say, <i>everything’s</i> bigger in Texas."; 
